package objects;/** * Created by Uno on 20.10.2016. */public class Activemqmessage {    private int customernumber;    private int materialnumber;    private String ordernumber;    private String timestamp;    public Activemqmessage(int customernumber, int materialnumber, String ordernumber, String timestamp) {        this.customernumber = customernumber;        this.materialnumber = materialnumber;        this.ordernumber = ordernumber;        this.timestamp = timestamp;    }    public int getCustomernumber() {        return customernumber;    }    public void setCustomernumber(int customernumber) {        this.customernumber = customernumber;    }    public int getMaterialnumber() {        return materialnumber;    }    public void setMaterialnumber(int materialnumber) {        this.materialnumber = materialnumber;    }    public String getOrdernumber() {        return ordernumber;    }    public void setOrdernumber(String ordernumber) {        this.ordernumber = ordernumber;    }    public String getTimestamp() {        return timestamp;    }    public void setTimestamp(String timestamp) {        this.timestamp = timestamp;    }}